style.css:
/* Apply dark theme to the Roblox main page */
body {
    background-color: #000 !important;
    color: #fff !important;
    font-family: Arial, sans-serif !important;
    margin: 0 !important;
    padding: 0 !important;
    position: relative; /* Ensure positioning for the pseudo-element */
    overflow: hidden;   /* Prevent scrollbars due to the fixed background */
}

/* Add custom background image with eyes repeating across the entire background */
body::before {
    content: "";
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: url('https://i.imgur.com/GoGS7Ne.jpeg') repeat;
    background-size: cover; /* Adjust size of the repeating image */
    opacity: 0.8; /* Adjust opacity for the desired effect */
    z-index: -1; /* Ensure the image stays in the background */
    pointer-events: none; /* Ensure the pseudo-element does not interfere with page interaction */
    display: block; /* Ensure the pseudo-element is displayed */
}

/* Ensure all text remains readable */
h1, h2, h3, h4, h5, h6, p, a, label, input, button {
    color: #fff !important;
}

/* Style forms and buttons */
input, button {
    background-color: #222 !important;
    color: #fff !important;
    border: 1px solid #444 !important;
    border-radius: 5px !important;
    padding: 0.5em !important;
}
